        <ul className="nav justify-content-center ">
          {/* home */}
          <li className="nav-item ">
            <NavLink className="nav-link active rounded-pill" to="/"> Home </NavLink>
          </li>

          {/* my account  */}
          <li className="nav-item">
            <a
              className="nav-link rounded-pill"
              href="#user"
              onClick={() => handlePageChange("User")}
            >
              {" "}
