            </a>
          </li>

          {/* products  */}
          <li className="nav-item">
            <a
              className="nav-link rounded-pill"
              href="#products"
              onClick={() => handlePageChange("Products")}
            >
              {" "}
              Shop{" "}
            </a>
          </li>

          {/* cart */}

          <li className="nav-item">
            <a
              className="nav-link rounded-pill"
              href="#cart"
              onClick={() => handlePageChange("Cart")}
