          <li className="nav-item">
            <a
              className="nav-link resume rounded-pill"
              href="#home"
              onClick={() => handlePageChange("Home")}
            >
              {" "}
              logout{" "}
            </a>
          </li>
        </ul>
      </nav>
    </>
  );
}

export default Header;
